lexes<br>that promote the range and intensity of FGF signals in the extracellular space. Regulates the<br>availability of insulin-like growth factors (IGFs) by cleaving IGF-binding proteins. Inhibits signa<br>[...]","Pleckstrin homology domain containing A6","Protein FAM171A1; Family with sequence similarity 171 member A1","Semaphorin-4A; Cell surface receptor for PLXNB1, PLXNB2, PLXNB3 and PLXND1 that plays an important<br>role in cell-cell signaling. Plays a role in priming antigen-specific T-cells, promotes<br>differentiation of Th1 T-helper cells, and thereby contributes to adaptive immunity. Promotes<br>phosphorylation of TIMD2. Inhibits angiogenesis. Promotes axon growth cone collapse. Inhibits axonal<br>extension by providing local signals to specify territories inaccessible for growing axons (By<br>similarity); Semaphorins","BTB/POZ domain-containing protein KCTD3; Accessory subunit of potassium/sodium hyperpolarization-<br>activated cyclic nucleotide-gated channel 3 (HCN3) upregulating its cell-surface expression and<br>current density without affecting its voltage dependence and kinetics; Belongs to the KCTD3 family","RNA polymerase II elongation factor ELL2; Elongation factor component of the super elongation complex<br>(SEC), a complex required to increase the catalytic rate of RNA polymerase II transcription by<br>suppressing transient pausing by the polymerase at multiple sites along the DNA. Component of the<br>little elongation complex (LEC), a complex required to regulate small nuclear RNA (snRNA) gene<br>transcription by RNA polymerase II and III. Plays a role in immunoglobulin secretion in plasma cells:<br>directs efficient alternative mRNA processing, influencing both proximal poly(A) site choice and exo<br>[...]","Tyrosine-protein phosphatase non-receptor type 12; Dephosphorylates a range of proteins, and thereby<br>regulates cellular signaling cascades. Dephosphorylates cellular tyrosine kinases, such as ERBB2 and<br>PTK2B/PYK2, and thereby regulates signaling via ERBB2 and PTK2B/PYK2. Selectively dephosphorylates<br>ERBB2 phosphorylated at 'Tyr-1112', 'Tyr-1196', and/or 'Tyr-1248'; Protein tyrosine phosphatases,<br>non-receptor type","Peripheral myelin protein 22; Might be involved in growth regulation, and in myelinization in the<br>peripheral nervous system; Belongs to the PMP-22/EMP/MP20 family","OTU domain-containing protein 7B; Negative regulator of the non-canonical NF-kappa-B pathway that acts<br>by mediating deubiquitination of TRAF3, an inhibitor of the NF-kappa-B pathway, thereby acting as a<br>negative regulator of B-cell responses. In response to non-canonical NF- kappa-B stimuli,<br>deubiquitinates 'Lys-48'-linked polyubiquitin chains of TRAF3, preventing TRAF3 proteolysis and<br>over-activation of non-canonical NF-kappa-B. Negatively regulates mucosal immunity against infections<br>(By similarity). Deubiquitinates ZAP70, and thereby regulates T cell receptor (TCR) signaling that le<br>[...]","Protein RUFY3; Plays a role in the generation of neuronal polarity formation and axon growth (By<br>similarity). Implicated in the formation of a single axon by developing neurons (By similarity). May<br>inhibit the formation of additional axons by inhibition of PI3K in minor neuronal processes (By<br>similarity). Plays a role in the formation of F-actin-enriched protrusive structures at the cell<br>periphery. Plays a role in cytoskeletal organization by regulating the subcellular localization of<br>FSCN1 and DBN1 at axonal growth cones (By similarity). Promotes gastric cancer cell migration and inva<br>[...]","Laminin subunit gamma-1; Binding to cells via a high affinity receptor, laminin is thought to mediate<br>the attachment, migration and organization of cells into tissues during embryonic development by<br>interacting with other extracellular matrix components","Epoxide hydrolase 1; Biotransformation enzyme that catalyzes the hydrolysis of arene and aliphatic<br>epoxides to less reactive and more ch is essential for kidney development. May also<br>play a role in the development and function of various tissues, regulating cell adhesion, spreading<br>and survival through the binding of several integrins (By similarity)","Angiopoietin-1; Binds and activates TEK/TIE2 receptor by inducing its dimerization and tyrosine<br>phosphorylation. Plays an important role in the regulation of angiogenesis, endothelial cell survival,<br>proliferation, migration, adhesion and cell spreading, reorganization of the actin cytoskeleton, but<br>also maintenance of vascular quiescence. Required for normal angiogenesis and heart development during<br>embryogenesis. After birth, activates or inhibits angiogenesis, depending on the context. Inhibits<br>angiogenesis and promotes vascular stability in quiescent vessels, where endothelial cells [...]","Ankyrin-2; In skeletal muscle, required for proper localization of DMD and DCTN4 and for the formation<br>and/or stability of a special subset of microtubules associated with costameres and neuromuscular<br>junctions. Attaches integral membrane proteins to cytoskeletal elements. Also binds to cytoskeletal<br>proteins. Required for coordinate assembly of Na/Ca exchanger, Na/K ATPase and InsP3 receptor at<br>sarcoplasmic reticulum sites in cardiomyocytes. Required for the coordinated expression of the Na/K<br>ATPase, Na/Ca exchanger and beta-2-spectrin (SPTBN1) in the inner segment of rod photoreceptor [...]","Alpha-(1,3)-fucosyltransferase 9; Transfers a fucose to lacto-N-neotetraose but not to either<br>alpha2,3-sialyl lacto-N-neotetraose or lacto-N-tetraose. Can catalyze the last step in the<br>biosynthesis of Lewis antigen, the addition of a fucose to precursor polysaccharides; Belongs to the<br>glycosyltransferase 10 family","Eyes absent homolog 2; Functions both as protein phosphatase and as transcriptional coactivator for<br>SIX1, and probably also for SIX2, SIX4 and SIX5. Tyrosine phosphatase that dephosphorylates 'Tyr-142'<br>of his n at metaphase-anaphase transition, robust<br>mitotic spindle formation and cytokinesis. Phosphorylates ATF4, CIR1, PTN, RAD26L, RBBP6, RPS7,<br>RPS6KB1, TRIP4, STAT3 and histones H1 and H3. Phosphorylates KIF11 to promote mitotic spindle<br>formation. Involved in G2/M phase cell cycle arrest induced by DNA damage. Inhibition of activity<br>results in apoptosis. May contribute to tumorigenesis by suppressing p53/TP53-induced cancer cell<br>senescence; [...]","Estrogen-related receptor gamma; Orphan receptor that acts as transcription activator in the absence<br>of bound ligand. Binds specifically to an estrogen response element and activates reporter genes<br>controlled by estrogen response elements (By similarity). Induces the expression of PERM1 in the<br>skeletal muscle; Nuclear hormone receptors","WD repeat-containing protein 17; WD repeat domain containing","Acyl-CoA synthetase family member 2, mitochondrial; Acyl-CoA synthases catalyze the initial reaction<br>in fatty acid metabolism, by forming a thioester with CoA. Has some preference toward medium-chain<br>substrates. Plays a role in adipocyte differentiation; Acyl-CoA synthetase family","Adenylate cyclase type 2; Catalyzes the formation of the signaling molecule cAMP in response to<br>G-protein signaling. Down-stream signaling cascades mediate changes in gene expression patterns and<br>lead to increased IL6 production. Functions in signaling cascades downstream of the muscarinic<br>acetylcholine receptors (By similarity); Belongs to the adenylyl cyclase class-4/guanylyl cyclase<br>family","GMP reductase 1; Catalyzes the irreversible NADPH-dependent deamination of GMP to IMP. It functions in<br>the conversion of nucleobase, nucleoside and nucleotide derivatives of G to A nucleotides, and in<br>maintaining the intracellular balance of A and G nucleotides; Belongs to the IMPDH/GMPR family. GuaC<br>type 1 subfamily","Dual specificity protein phosphatase CDC14A; Dual-specificity phosphatase. Required for centro n of neuronal excitability; Belongs to the<br>potassium channel family. KQT (TC 1.A.1.15) subfamily. Kv7.3/KCNQ3 sub-subfamily","Protein NDRG1; Stress-responsive protein involved in hormone responses, cell growth, and<br>differentiation. Acts as a tumor suppressor in many cell types. Necessary but not sufficient for<br>p53/TP53- mediated caspase activation and apoptosis. Has a role in cell trafficking, notably of the<br>Schwann cell, and is necessary for the maintenance and development of the peripheral nerve myelin<br>sheath. Required for vesicular recycling of CDH1 and TF. May also function in lipid trafficking.<br>Protects cells from spindle disruption damage. Functions in p53/TP53-dependent mitotic spindle<br>checkpoint. Regu [...]","Ethanolamine-phosphate phospho-lyase; Catalyzes the pyridoxal-phosphate-dependent breakdown of<br>phosphoethanolamine, converting it to ammonia, inorganic phosphate and acetaldehyde","SHC-transforming protein 3; Signaling adapter that couples activated growth factor receptors to<br>signaling pathway in neurons. Involved in the signal transduction pathways of neurotrophin-activated<br>Trk receptors in cortical neurons; SH2 domain containing","A-kinase anchor protein 13; Scaffold protein that plays an important role in assembling signaling<br>complexes downstream of several types of G protein-coupled receptors. Activates RHOA in response to<br>signaling via G protein-coupled receptors via its function as Rho guanine nucleotide exchange factor.<br>May also activate other Rho family members. Part of a kinase signaling complex that links ADRA1A and<br>ADRA1B adrenergic receptor signaling to the activation of downstream p38 MAP kinases, such as MAPK11<br>and MAPK14. Part of a signaling complex that links ADRA1B signaling to the activation of R [...]","Glypican-6; Cell surface proteoglycan that bears heparan sulfate. Putative cell surface coreceptor for<br>growth factors, extracellular matrix proteins, proteases and anti-proteases (By similarity). Enhances<br>migration and invasion of cancer cells through WNT5A signaling; Belongs to the glypican family","DENN domain-containing protein 1A; Guanine nucleotide exchange factor (GEF) regulating<br>clathrin-mediated endocytosis through RAB35 activation. Promotes the exchange of GDP to GTP,<br>converting inactive GDP-bound RAB35 into its active GTP-bound form. Regulates clathrin-mediated<br>endocytosis of synaptic vesicles and mediates exit from early endosomes. Binds<br>phosphatidylinositol-phosphates (PtdInsPs), with some preference for PtdIns(3)P (By similarity);<br>DENN/MADD domain containing","LIM/homeobox protein Lhx2; Acts as a transcriptional activator. Stimulates the promoter of the<br>alpha-glycoprotein gene. Transcriptional regulatory protein involved in the control of cell<br>differentiation in developing lymphoid and neural cell types (By similarity); LIM class homeoboxes","Guanine nucleotide-binding protein subunit alpha-12; Guanine nucleotide-binding proteins (G proteins)<br>are involved as modulators or transducers in various transmembrane signaling systems. Activates<br>effector molecule RhoA by binding and activating RhoGEFs (ARHGEF12/LARG). GNA12-dependent Rho<br>signaling subsequently regulates transcription factor AP-1 (activating protein-1) (By similarity).<br>GNA12-dependent Rho signaling also regulates protein phosphatese 2A activation causing<br>dephosphorylation of its target proteins. Promotes tumor cell invasion and metastasis by activating<br>RhoA/ROCK sign [...]","Midnolin; Facilitates ubiquitin-independent proteasomal degradation of polycomb protein CBX4. Plays a<br>role in inhibiting the activity of glucokinase GCK and both glucose-induced and basal insulin<br>secretion","Not identified in database","Myomesin-1; Major component of the vertebrate myofibrillar M band. Binds myosin, titin, and light<br>meromyosin. This binding is dose dependent; Fibronectin type III domain containing","Neuron navigator 2; Possesses 3' to 5' helicase activity and exonuclease activity. Involved in<br>neuronal development, specifically in the development of different sensory organs; Belongs to the<br>Nav/unc-53 family","Thrombospondin-2; Adhesive glycoprotein that mediates cell-to-cell and cell-to-matrix interactions.<br>Ligand for CD36 mediating antiangiogenic properties","Tripartite motif containing 47; Ring finger proteins","Formin-like protein 2; Plays a role in the regulation of cell morphology and cytoskeletal<br>organization. Required in the cortical actin filament dynamics; Belongs to the formin homology family","Nebulette; Binds to actin and plays an important role in the assembly of the Z-disk. May functionally<br>link sarcomeric actin to the desmin intermediate filaments in the heart muscle sarcomeres. Isoform 2<br>might play a role in the assembly of focal adhesion; LIM domain containing","Putative Polycomb group protein ASXL2; Putative Polycomb group (PcG) protein. PcG proteins act by<br>forming multiprotein complexes, which are required to maintain the transcriptionally repressive state<br>of homeotic genes throughout development. PcG proteins are not required to initiate repression, but to<br>maintain it during later stages of development. They probably act via methylation of histones,<br>rendering chromatin heritably changed in its expressibility (By similarity). Involved in<br>transcriptional regulation mediated by ligand-bound nuclear hormone receptors, such as peroxisome<br>prolife [...]","WD repeat and FYVE domain-containing protein 2; Acts in an adapter protein-like fashion to mediate the<br>interaction between the kinase PRKCZ and its substrate VAMP2 and increases the PRKCZ-dependent<br>phosphorylation of VAMP2. Positively regulates adipocyte differentiation, by facilitating the<br>phosphorylation and thus inactivation of the anti-adipogenetic transcription factor FOXO1 by the<br>kinase AKT1. Plays a role in endosomal control of AKT2 signaling; required for insulin-stimulated AKT2<br>phosphorylation and glucose uptake and insulin-stimulated phosphorylation of AKT2 substrates (By sim<br>[...]","Leucine-rich glioma-inactivated protein 1; Regulates voltage-gated potassium channels assembled from<br>KCNA1, KCNA4 and KCNAB1. It slows down channel inactivation by precluding channel closure mediated by<br>the KCNAB1 subunit. Ligand for ADAM22 that positively regulates synaptic transmission mediated by<br>AMPA-type glutamate receptors (By similarity). Plays a role in suppressing the production of MMP1/3<br>through the phosphatidylinositol 3-kinase/ERK pathway. May play a role in the control of neuroblastoma<br>cell survival","Neuropilin-1; The membrane-bound isoform 1 is a receptor involved in the development of the<br>cardiovascular system, in angiogenesis, in the formation of certain neuronal circuits and in<br>organogenesis outside the nervous system. It mediates the chemorepulsant activity of semaphorins. It<br>binds to semaphorin 3A, The PLGF-2 isoform of PGF, The VEGF165 isoform of VEGFA and VEGFB.<br>Coexpression with KDR results in increased VEGF165 binding to KDR as well as increased chemotaxis.<br>Regulate VEGF-induced angiogenesis. Binding to VEGFA initiates a signaling pathway needed for motor<br>neuron axon guid [...]","Not identified in database","Cell division cycle 7-related protein kinase; Seems to phosphorylate critical substrates that regulate<br>the G1/S phase transition and/or DNA replication. Can phosphorylates MCM2 and MCM3","Protein tyrosine phosphatase type IVA 3; Protein tyrosine phosphatase which stimulates progression<br>from G1 into S phase during mitosis. Enhances cell proliferation, cell motility and invasive activity,<br>and promotes cancer metastasis. May be involved in the progression of cardiac hypertrophy by<br>inhibiting intracellular calcium mobilization in response to angiotensin II; Protein tyrosine<br>phosphatases type IVA","Leiomodin-1; Mediates nucleation of actin filaments; Belongs to the tropomodulin family","Monocarboxylate transporter 9; Proton-linked monocarboxylate transporter. May catalyze the transport<br>of monocarboxylates across the plasma membrane; Solute carriers","Cyclin-G2; May play a role in growth regulation and in negative regulation of cell cycle progression;<br>Belongs to the cyclin family. Cyclin G subfamily","Histone chaperone ASF1A; Histone chaperone that facilitates histone deposition and histone exchange<br>and removal during nucleosome assembly and disassembly. Cooperates with chromatin assembly factor 1<br>(CAF-1) to promote replication-dependent chromatin assembly and with HIRA to promote<br>replication-independent chromatin assembly. Required for the formation of senescence-associated<br>heterochromatin foci (SAHF) and efficient senescence-associated cell cycle exit; Belongs to the ASF1<br>family","Integral membrane protein GPR137B; G protein-coupled receptor 137B; Belongs to the GPR137 family","Anaphase-promoting complex subunit 16; Component of the anaphase promoting complex/cyclosome (APC/C),<br>a cell cycle-regulated E3 ubiquitin ligase that controls progression through mitosis and the G1 phase<br>of the cell cycle. The APC/C complex acts by mediating ubiquitination and subsequent degradation of<br>target proteins: it mainly mediates the formation of 'Lys-11'-linked polyubiquitin chains and, to a<br>lower extent, the formation of 'Lys-48'- and 'Lys-63'-linked polyubiquitin chains; Belongs to the<br>APC16 family","Heat shock protein HSP 90-alpha; Molecular chaperone that promotes the maturation, structural<br>maintenance and proper regulation of specific target proteins involved for instance in cell cycle<br>control and signal transduction. Undergoes a functional cycle that is linked to its ATPase activity<br>which is essential for its chaperone activity. This cycle probably induces conformational changes in<br>the client proteins, thereby causing their activation. Interacts dynamically with various<br>co-chaperones that modulate its substrate recognition, ATPase cycle and chaperone function. Engages<br>with a ra [...]","Prolyl 4-hydroxylase subunit alpha-1; Catalyzes the post-translational formation of 4- hydroxyproline<br>in -Xaa-Pro-Gly- sequences in collagens and other proteins; Belongs to the P4HA family","Cholesterol transporter that mediates non-vesicular transport of cholesterol from the plasma membrane<br>(PM) to the endoplasmic reticulum (ER) (By similarity). Contains unique domains for binding<br>cholesterol and the PM, thereby serving as a molecular bridge for the transfer of cholesterol from the<br>PM to the ER (By similarity). Plays a crucial role in cholesterol homeostasis in the adrenal gland and<br>has the unique ability to localize to the PM based on the level of membrane cholesterol (By<br>similarity). In lipid-poor conditions localizes to the ER membrane and in response to excess cholest<br>[...]","Acetyl-coenzyme A synthetase 2-like, mitochondrial; Important for maintaining normal body temperature<br>during fasting and for energy homeostasis. Essential for energy expenditure under ketogenic conditions<br>(By similarity). Converts acetate to acetyl-CoA so that it can be used for oxidation through the<br>tricarboxylic cycle to produce ATP and CO(2); Belongs to the ATP-dependent AMP-binding enzyme family","Fatty acid hydroxylase domain containing 2; Belongs to the sterol desaturase family","Dual specificity mitogen-activated protein kinase kinase 6; Dual specificity protein kinase which acts<br>as an essential component of the MAP kinase signal transduction pathway. With MAP3K3/MKK3, catalyzes<br>the concomitant phosphorylation of a threonine and a tyrosine residue in the MAP kinases p38 MAPK11,<br>MAPK12, MAPK13 and MAPK14 and plays an important role in the regulation of cellular responses to<br>cytokines and all kinds of stresses. Especially, MAP2K3/MKK3 and MAP2K6/MKK6 are both essential for<br>the activation of MAPK11 and MAPK13 induced by environmental stress, whereas MAP2K6/MKK6 i [...]","Zinc finger MIZ domain-containing protein 1; Acts as transcriptional coactivator. Increases ligand-<br>dependent transcriptional activity of AR and promotes AR sumoylation. The stimulation of AR activity<br>is dependent upon sumoylation. Involved in transcriptional activation of a subset of NOTCH1 target<br>genes including MYC. Involved in thymocyte and T cell development (By similarity); Zinc fingers<br>MIZ-type","Bone morphogenetic protein receptor type-1A; On ligand binding, forms a receptor complex consisting of<br>two type II and two type I transmembrane serine/threonine kinases. Type II receptors phosphorylate and<br>activate type I receptors which autophosphorylate, then bind and activate SMAD transcriptional<br>regulators. Receptor for BMP2, BMP4, GDF5 and GDF6. Positively regulates chondrocyte differentiation<br>through GDF5 interaction. Mediates induction of adipogenesis by GDF6; Belongs to the protein kinase<br>superfamily. TKL Ser/Thr protein kinase family. TGFB receptor subfamily","Alpha-1A adrenergic receptor; This alpha-adrenergic receptor mediates its action by association with G<br>proteins that activate a phosphatidylinositol- calcium second messenger system. Its effect is mediated<br>by G(q) and G(11) proteins. Nuclear ADRA1A-ADRA1B heterooligomers regulate<br>phenylephrine(PE)-stimulated ERK signaling in cardiac myocytes; Belongs to the G-protein coupled<br>receptor 1 family. Adrenergic receptor subfamily. ADRA1A sub-subfamily","Mitochondrial Rho GTPase 1; Mitochondrial GTPase involved in mitochondrial trafficking. Probably<br>involved in control of anterograde transport of mitochondria and their subcellular distribution;<br>EF-hand domain containing","1-phosphatidylinositol 4,5-bisphosphate phosphodiesterase epsilon-1; The production of the second<br>messenger molecules diacylglycerol (DAG) and inositol 1,4,5-trisphosphate (IP3) is mediated by<br>activated phosphatidylinositol-specific phospholipase C enzymes. PLCE1 is a bifunctional enzyme which<br>also regulates small GTPases of the Ras superfamily through its Ras guanine- exchange factor (RasGEF)<br>activity. As an effector of heterotrimeric and small G-protein, it may play a role in cell survival,<br>cell growth, actin organization and T-cell activation; C2 domain containing phospholipases","Beta-galactoside alpha-2,6-sialyltransferase 1; Transfers sialic acid from CMP-sialic acid to<br>galactose- containing acceptor substrates; Sialyltransferases","Disheveled-associated activator of morphogenesis 1; Binds to disheveled (Dvl) and Rho, and mediates<br>Wnt- induced Dvl-Rho complex formation. May play a role as a scaffolding protein to recruit Rho-GDP<br>and Rho-GEF, thereby enhancing Rho-GTP formation. Can direct nucleation and elongation of new actin<br>filaments. Involved in building functional cilia. Involved in the organization of the subapical actin<br>network in multiciliated epithelial cells (By similarity); Belongs to the formin homology family","Not identified in database","Structural maintenance of chromosomes protein 5; Core component of the SMC5-SMC6 complex, a complex<br>involved in repair of DNA double-strand breaks by homologous recombination. The complex may promote<br>sister chromatid homologous recombination by recruiting the SMC1-SMC3 cohesin complex to double-strand<br>breaks. The complex is required for telomere maintenance via recombination in ALT (alternative<br>lengthening of telomeres) cell lines and mediates sumoylation of shelterin complex (telosome)<br>components which is proposed to lead to shelterin complex disassembly in ALT-associated PML bodies (<br>[...]","Ectonucleoside triphosphate diphosphohydrolase 1; In the nervous system, could hydrolyze ATP and other<br>nucleotides to regulate purinergic neurotransmission. Could also be implicated in the prevention of<br>platelet aggregation by hydrolyzing platelet-activating ADP to AMP. Hydrolyzes ATP and ADP equally<br>well; Belongs to the GDA1/CD39 NTPase family","Sulfatase-modifying factor 1; Using molecular oxygen and an unidentified reducing agent, oxidizes a<br>cysteine residue in the substrate sulfatase to an active site 3-oxoalanine residue, which is also<br>called C(alpha)-formylglycine. Known substrates include GALNS, ARSA, STS and ARSE; Belongs to the<br>sulfatase-modifying factor family","Ligand-dependent corepressor; May act as transcription activator that binds DNA elements with the<br>sequence 5'-CCCTATCGATCGATCTCTACCT-3' (By similarity). Repressor of ligand-dependent transcription<br>activation by target nuclear receptors. Repressor of ligand- dependent transcription activation by<br>ESR1, ESR2, NR3C1, PGR, RARA, RARB, RARG, RXRA and VDR","Ras association domain family member 8","Protocadherin-17; Potential calcium-dependent cell-adhesion protein; Non-clustered protocadherins","Collagen alpha-3(V) chain; Type V collagen is a member of group I collagen (fibrillar forming<br>collagen). It is a minor connective tissue component of nearly ubiquitous distribution. Type V<br>collagen binds to DNA, heparan sulfate, thrombospondin, heparin, and insulin","Not identified in database","V-type proton ATPase 116 kDa subunit a isoform 1; Required for assembly and activity of the vacuolar<br>ATPase. Potential role in differential targeting and regulation of the enzyme for a specific organelle<br>(By similarity); V-type ATPases","Testis-expressed protein 9; Testis expressed 9","Dynein heavy chain 9, axonemal; Force generating protein of respiratory cilia. Produces force towards<br>the minus ends of microtubules. Dynein has ATPase activity; the force-producing power stroke is<br>thought to occur on release of ADP; Dyneins, axonemal","Actin-binding LIM protein 1; May act as scaffold protein (By similarity). May play a role in the<br>development of the retina. Has been suggested to play a role in axon guidance; LIM domain containing","G protein-coupled receptor kinase 5; Serine/threonine kinase that phosphorylates preferentially the<br>activated forms of a variety of G-protein- coupled receptors (GPCRs). Such receptor phosphorylation<br>initiates beta-arrestin-mediated receptor desensitization, internalization, and signaling events<br>leading to their down-regulation. Phosphorylates a variety of GPCRs, including adrenergic receptors,<br>muscarinic acetylcholine receptors (more specifically Gi-coupled M2/M4 subtypes), dopamine receptors<br>and opioid receptors. In addition to GPCRs, also phosphorylates various substrates: Hsc70- in [...]","Protein BANP; Controls V(D)J recombination during T-cell development by repressing T-cell receptor<br>(TCR) beta enhancer function. Binds to scaffold/matrix attachment region beta (S/MARbeta), an ATC-rich<br>DNA sequence located upstream of the TCR beta enhancer. Represses cyclin D1 transcription by<br>recruiting HDAC1 to its promoter, thereby diminishing H3K9ac, H3S10ph and H4K8ac levels. Promotes TP53<br>'Ser-15' phosphorylation and nuclear accumulation, which causes cell cycle arrest (By similarity);<br>Belongs to the BANP/SMAR1 family","Ral GTPase-activating protein subunit alpha-2; Catalytic subunit of the heterodimeric RalGAP2 complex<br>which acts as a GTPase activator for the Ras-like small GTPases RALA and RALB; Armadillo-like helical<br>domain containing","Breakpoint cluster region protein; GTPase-activating protein for RAC1 and CDC42. Promotes the exchange<br>of RAC or CDC42-bound GDP by GTP, thereby activating them. Displays serine/threonine kinase activity;<br>C2 domain containing","Interleukin-6 receptor subunit alpha; Part of the receptor for interleukin 6. Binds to IL6 with low<br>affinity, but does not transduce a signal. Signal activation necessitate an association with IL6ST.<br>Activation may lead to the regulation of the immune response, acute-phase reactions and hematopoiesis;<br>CD molecules","Alpha-aminoadipic semialdehyde synthase, mitochondrial; Bifunctional enzyme that catalyzes the first<br>two steps in lysine degradation. The N-terminal and the C-terminal contain lysine-ketoglutarate<br>reductase and saccharopine dehydrogenase activity, respectively","C-terminal-binding protein 2; Corepressor targeting diverse transcription regulators. Functions in<br>brown adipose tissue (BAT) differentiation (By similarity)","Disintegrin and metalloproteinase domain-containing protein 12; Involved in skeletal muscle<br>regeneration, specifically at the onset of cell fusion. Also involved in macrophage-derived giant<br>cells (MGC) and osteoclast formation from mononuclear precursors (By similarity); ADAM<br>metallopeptidase domain containing","Neuronal PAS domain-containing protein 2; Transcriptional activator which forms a core component of<br>the circadian clock. The circadian clock, an internal time- keeping system, regulates various<br>physiological processes through the generation of approximately 24 hour circadian rhythms in gene<br>expression, which are translated into rhythms in metabolism and behavior. It is derived from the Latin<br>roots 'circa' (about) and 'diem' (day) and acts as an important regulator of a wide array of<br>physiological functions including metabolism, sleep, body temperature, blood pressure, endocrine,<br>immune [...]","Interferon-induced transmembrane protein 2; IFN-induced antiviral protein which inhibits the entry of<br>viruses to the host cell cytoplasm, permitting endocytosis, but preventing subsequent viral fusion and<br>release of viral contents into the cytosol. Active against multiple viruses, including influenza A<br>virus, SARS coronavirus (SARS-CoV), Marburg virus (MARV), Ebola virus (EBOV), Dengue virus (DNV), West<br>Nile virus (WNV), human immunodeficiency virus type 1 (HIV-1) and vesicular stomatitis virus (VSV).<br>Can inhibit: influenza virus hemagglutinin protein-mediated viral entry, MARV and EBO [...]","Acyl-CoA-binding protein; Binds medium- and long-chain acyl-CoA esters with very high affinity and may<br>function as an intracellular carrier of acyl-CoA esters. It is also able to displace diazepam from the<br>benzodiazepine (BZD) recognition site located on the GABA type A receptor. It is therefore possible<br>that this protein also acts as a neuropeptide to modulate the action of the GABA receptor","Bax inhibitor 1; Suppressor of apoptosis. Modulates unfolded protein response signaling. Modulates ER<br>calcium homeostasis by acting as a calcium-leak channel. Negatively regulates autophagy and<br>autophagosome formation, especially during periods of nutrient deprivation, and reduces cell survival<br>during starvation (By similarity); Transmembrane BAX inhibitor motif containing","Protein transport protein Sec61 subunit alpha isoform 1; Plays a crucial role in the insertion of<br>secretory and membrane polypeptides into the ER. Required for assembly of membrane and secretory<br>proteins. Tightly associated with membrane- bound ribosomes, either directly or through adapter<br>proteins. Plays a role in pronephric kidney tubule development (By similarity); Belongs to the<br>SecY/SEC61-alpha family","ER lumen protein-retaining receptor 2; Required for the retention of luminal endoplasmic reticulum<br>proteins. Determines the specificity of the luminal ER protein retention system. Also required for<br>normal vesicular traffic through the Golgi. This receptor recognizes K-D-E-L","Sphingomyelin phosphodiesterase; Converts sphingomyelin to ceramide. Also has phospholipase C<br>activities toward 1,2-diacylglycerolphosphocholine and 1,2-diacylglycerolphosphoglycerol","Protein disulfide-isomerase; This multifunctional protein catalyzes the formation, breakage and<br>rearrangement of disulfide bonds. At the cell surface, seems to act as a reductase that cleaves<br>disulfide bonds of proteins attached to the cell. May therefore cause structural modifications of<br>exofacial proteins. Inside the cell, seems to form/rearrange disulfide bonds of nascent proteins. At<br>high concentrations, functions as a chaperone that inhibits aggregation of misfolded proteins. At low<br>concentrations, facilitates aggregation (anti-chaperone activity). May be involved with other chape<br>[...]","Dickkopf-related protein 3; Antagonizes canonical Wnt signaling by inhibiting LRP5/6 interaction with<br>Wnt and by forming a ternary complex with the transmembrane protein KREMEN that promotes<br>internalization of LRP5/6. DKKs play an important role in vertebrate development, where they locally<br>inhibit Wnt regulated processes such as antero- posterior axial patterning, limb development,<br>somitogenesis and eye formation. In the adult, Dkks are implicated in bone formation and bone disease,<br>cancer and Alzheimer disease (By similarity); Belongs to the dickkopf family","Aquaporin-4; Forms a water-specific channel. Osmoreceptor which regulates body water balance and<br>mediates water flow within the central nervous system; Belongs to the MIP/aquaporin (TC 1.A.8) family","Transcription factor RFX3; Transcription factor required for ciliogenesis and islet cell<br>differentiation during endocrine pancreas development. Essential for the differentiation of nodal<br>monocilia and left- right asymmetry specification during embryogenesis. Required for the biogenesis of<br>motile cilia by governing growth and beating efficiency of motile cells. Also required for ciliated<br>ependymal cell differentiation. Regulates the expression of genes involved in ciliary assembly<br>(DYNC2LI1, FOXJ1 and BBS4) and genes involved in ciliary motility (DNAH11, DNAH9 and DNAH5) (By<br>similarity) [...]","Pleckstrin homology domain-containing family A member 7; Required for zonula adherens biogenesis and<br>maintenance. Acts via its interaction with KIAA1543/Nezha, which anchors microtubules at their<br>minus-ends to zonula adherens, leading to the recruitment of KIFC3 kinesin to the junctional site;<br>Pleckstrin homology domain containing","DNA-binding protein RFX2; Transcription factor that acts as a key regulator of spermatogenesis. Acts<br>by regulating expression of genes required for the haploid phase during spermiogenesis, such as genes<br>required for cilium assembly and function (By similarity). Recognizes and binds the X-box, a<br>regulatory motif with DNA sequence 5'-GTNRCC(0-3N)RGYAAC-3' present on promoters. Probably activates<br>transcription of the testis- specific histone gene HIST1H1T (By similarity)","Protein arginine N-methyltransferase 3; Methylates (mono and asymmetric dimethylation) the guanidino<br>nitrogens of arginyl residues in some proteins; Protein arginine methyltransferases","Leucine-rich repeat-containing G-protein coupled receptor 4; Receptor for R-spondins that potentiates<br>the canonical Wnt signaling pathway and is involved in the formation of various organs. Upon binding<br>to R-spondins (RSPO1, RSPO2, RSPO3 or RSPO4), associates with phosphorylated LRP6 and frizzled<br>receptors that are activated by extracellular Wnt receptors, triggering the canonical Wnt signaling<br>pathway to increase expression of target genes. In contrast to classical G-protein coupled receptors,<br>does not activate heterotrimeric G-proteins to transduce the signal. Its function as activat [...]","CD59 glycoprotein; Potent inhibitor of the complement membrane attack complex (MAC) action. Acts by<br>binding to the C8 and/or C9 complements of the assembling MAC, thereby preventing incorporation of the<br>multiple copies of C9 required for complete formation of the osmolytic pore. This inhibitor appears to<br>be species-specific. Involved in signal transduction for T-cell activation complexed to a protein<br>tyrosine kinase; Blood group antigens","Clusterin; Isoform 1 functions as extracellular chaperone that prevents aggregation of nonnative<br>proteins. Prevents stress- induced aggregation of blood plasma proteins. Inhibits formation of amyloid<br>fibrils by APP, APOC2, B2M, CALCA, CSN3, SNCA and aggregation-prone LYZ variants (in vitro). Does not<br>require ATP. Maintains partially unfolded proteins in a state appropriate for subsequent refolding by<br>other chaperones, such as HSPA8/HSC70. Does not refold proteins by itself. Binding to cell surface<br>receptors triggers internalization of the chaperone-client complex and subsequent lysosom [...]","Interleukin-1 receptor type 1; Receptor for IL1A, IL1B and IL1RN. After binding to interleukin-1<br>associates with the coreceptor IL1RAP to form the high affinity interleukin-1 receptor complex which<br>mediates interleukin-1-dependent activation of NF-kappa-B, MAPK and other pathways. Signaling involves<br>the recruitment of adapter molecules such as TOLLIP, MYD88, and IRAK1 or IRAK2 via the respective TIR<br>domains of the receptor/coreceptor subunits. Binds ligands with comparable affinity and binding of<br>antagonist IL1RN prevents association with IL1RAP to form a signaling complex","Not identified in database","Mannosyl-oligosaccharide 1,2-alpha-mannosidase IC; Involved in the maturation of Asn-linked<br>oligosaccharides. Trim alpha-1,2-linked mannose residues from Man(9)GlcNAc(2) to produce first<br>Man(8)GlcNAc(2) then Man(6)GlcNAc and a small amount of Man(5)GlcNAc","Matrilin-2; Involved in matrix assembly; Matrilins","Not identified in database","Glycerol-3-phosphate acyltransferase 1, mitochondrial; Esterifies acyl-group from acyl-ACP to the sn-1<br>position of glycerol-3-phosphate, an essential step in glycerolipid biosynthesis","Not identified in database","Diacylglycerol kinase zeta; Displays a strong preference for 1,2-diacylglycerols over<br>1,3-diacylglycerols, but lacks substrate specificity among molecular species of long chain<br>diacylglycerols. Isoform 2 but not isoform 1 regulates RASGRP1 activity; Belongs to the eukaryotic<br>diacylglycerol kinase family","Apelin receptor; Receptor for apelin receptor early endogenous ligand (APELA) and apelin (APLN)<br>hormones coupled to G proteins that inhibit adenylate cyclase activity. Plays a key role in early<br>development such as gastrula ion<br>factor E2F from the RB/E2F complex and the subsequent transcription of E2F target genes which are<br>responsible for the progression through the G(1) phase. Hypophosphorylates RB1 in early G(1) phase.<br>Cyclin D-CDK4 complexes are major integrators of various mitogenenic and antimitogenic signals. A<br>[...]","Tumor necrosis factor receptor superfamily member 1A; Receptor for TNFSF2/TNF-alpha and homotrimeric<br>TNFSF1/lymphotoxin-alpha. The adapter molecule FADD recruits caspase-8 to the activated receptor. The<br>resulting death-inducing signaling complex (DISC) performs caspase-8 proteolytic activation which<br>initiates the subsequent cascade of caspases (aspartate- specific cysteine proteases) mediating<br>apoptosis. Contributes to the induction of non-cytocidal TNF effects including anti-viral state and<br>activation of the acid sphingomyelinase; CD molecules","Protein lifeguard 3; Negatively regulates aortic matrix metalloproteinase-9 (MMP9) production and may<br>play a protective role in vascular remodeling; Transmembrane BAX inhibitor motif containing","Protein shisa-5; Can induce apoptosis in a caspase-dependent manner and plays a role in<br>p53/TP53-dependent apoptosis; Shisa family members","Small conductance calcium-activated potassium channel protein 3; Forms a voltage-independent potassium<br>channel activated by intracellular calcium. Activation is followed by membrane hyperpolarization.<br>Thought to regulate neuronal excitability by contributing to the slow component of synaptic<br>afterhyperpolarization. The channel is blocked by apamin; Potassium calcium-activated channels","Monoacylglycerol lipase ABHD2; Progesterone-dependent acylglycerol lipase that catalyzes hydrolysis of<br>endocannabinoid arachidonoylglycerol (AG) from cell membrane. Acts as a progesterone receptor:<br>progesterone-binding activates the acylglycerol lipase activity, mediating degradation of<br>1-arachidonoylglycerol (1AG) and 2-arachidonoylglycerol (2AG) to glycerol
